import React from "react";
import "./styles/Home.css";
import { CSSTransition, TransitionGroup } from "react-transition-group";


function Home() {
  return (
    <TransitionGroup>
      <CSSTransition
        classNames="fade-in"
        timeout={5000}
        in={true}>
        <h3 className={"title-text"}>Hi, I'm James.</h3>
      </CSSTransition>
    </TransitionGroup>
  );
}

export default Home;
